import React from "react";
import "./Sidebar.css";
import User from "./components/User"

const Sidebar = ({ contacts }) => {
	return (
		<aside className="sidebar">
			{
				contacts.map(
					contact => <User user={contact} key={contact.id} />
				)
			}
		</aside>
	);
}

export default Sidebar;
